import { useEffect, useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";
import { useNavigate } from "react-router-dom";
import image from "./images/bann5.jpg";

function Login(props) {
  const [credentials, setcredentials] = useState({
    username: "",
    password: "",
  });
  const [message, setmessage] = useState("");
  const navigate = useNavigate()

  useEffect(() => {
    if (message !== "") {
      setTimeout(() => {
        setmessage("");
      }, 3000);
    }
  }, [message]);

  const OnTextChange = (args) => {
    var copyOfcredentials = { ...credentials };
    copyOfcredentials[args.target.name] = args.target.value;
    setcredentials(copyOfcredentials);
  };

  const SignIn = () => {
    debugger;

    if (credentials.role == "Admin") {
      history.push("/admin");
    } else if (credentials.role == "Deliveryboy") {
      history.push("./deliveryboy");
    } else {
      setmessage("credetials are invalid");
    }
    // var helper=new XMLHttpRequest();
    // helper.onreadystatechange=()=>{
    //     if(helper.readyState===4 && helper.status===200)
    //     {
    //         var responseReceived=JSON.parse(helper.responseText);
    //         if(responseReceived.isvalid==='true')
    //         {
    //             sessionStorage.setItem("isloggedin",true);
    //             sessionStorage.setItem("username",credentials.username);
    //             props.setUserName(credentials.username);

    //             history.push("/");
    //         }
    //         else{
    //             setmessage("credentials are invalid");
    //             setcredentials({username:"",password:""});
    //         }
    //     }
    // }
    // helper.open("POST","http://127.0.0.1:9999/login");
    // helper.setRequestHeader("Content-Type","application/json");
    // var credentialsInString=JSON.stringify(credentials);
    // var credentialsInEncoded=window.btoa(credentialsInString);
    // var details={"credentials":credentialsInEncoded}
    // helper.send(JSON.stringify(details));
  };

  return (
    <>
      <div className="length">
        <div style={{ backgroundImage: `url(${image})` }}>
          <div>
            <div>
              <center>
                <table className="len">
                  <tbody>
                    <tr>
                      <td className="col">
                        <h3> User Name</h3>
                      </td>
                      <td>
                        <input
                          type="text"
                          placeholder="Enter username"
                          value={credentials.username}
                          name="username"
                          onChange={OnTextChange}
                        />
                      </td>
                    </tr>
                    <tr>
                      <td className="col">
                        <h3> Password</h3>
                      </td>
                      <td>
                        <input
                          type="text"
                          placeholder="Enter password"
                          value={credentials.password}
                          name="password"
                          onChange={OnTextChange}
                        />
                      </td>
                    </tr>
                    <tr>
                      <td className="col">
                        <h3>Role</h3>
                      </td>
                      <td>
                        <select name="role" onChange={OnTextChange}>
                          <option value="Select">Select Role</option>

                          <option value={credentials.Admin}>Admin</option>
                          <option value={credentials.Deliveryboy}>
                            Deliveryboy
                          </option>
                        </select>
                      </td>
                    </tr>
                    <tr>
                      <td colSpan={"2"}>
                        <button onClick={SignIn} className="btn btn-primary">
                          LogIn
                        </button>

                        <div className="colr">{message}</div>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </center>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Login;
